/**
 * Companion instance icons class for thelightingcontroller module.
 * Utilized to generate/recall various icons.
 *
 * @version 1.1.0
 * @since 1.1.0
 * @author Craig Dean <thargy@yahoo.com>
 */
class instanceIcons {

	/**
	 * Create an instance of a thelightingcontroller icons module.
	 *
	 * @param {instance} instance - the parent instance
	 * @since 1.1.0
	 */
    constructor(instance) {
        this.instance = instance;

        const IMAGEHEAD = 'iVBORw0KGgoAAAANSUhEUgAAA';
        this.buttonIconsByType = [{
            // Steps
            image: IMAGEHEAD + '',
            imageFlash: IMAGEHEAD + ''
        }, {
            // Generator
            image: IMAGEHEAD + '',
            imageFlash: IMAGEHEAD + ''
        }, {
            // Pixels
            image: IMAGEHEAD + '',
            imageFlash: IMAGEHEAD + ''
        }, {
            // Media
            image: IMAGEHEAD + '',
            imageFlash: IMAGEHEAD + ''
        }, {
            // Timeline
            image: IMAGEHEAD + '',
            imageFlash: IMAGEHEAD + ''
        }, {
            // Macro
            image: IMAGEHEAD + '',
            imageFlash: IMAGEHEAD + ''
        }];

        const TIMELINEHEAD = IMAGEHEAD + '';
        this.timeline = {
            playfrom: TIMELINEHEAD + '',
            play: TIMELINEHEAD + '',
            pause: TIMELINEHEAD + '',
            stop: TIMELINEHEAD + ''
        }
        this.sequence = IMAGEHEAD + ''
        this.freeze = IMAGEHEAD + '';
        this.audioBPM = IMAGEHEAD + ''
        const BEATHEAD = IMAGEHEAD + '';
        this.beat = [
            BEATHEAD + '',
            BEATHEAD + '',
            BEATHEAD + '',
            BEATHEAD + '',
            BEATHEAD + '',
        ];
    }

    /**
     * Gets the image for a button based on its type, and whether it is a flash button.
     * 
     * @returns {string} base64 encoded image, or undefined.
     * @param {number} type - the type of the button
     * @param {boolean} flash - whether the button is a flash
	 * @access public
	 * @since 1.1.0
     */
    getButtonIcon(type, flash) {
        var b = this.buttonIconsByType[type];
        if (b) {
            return flash ? b.imageFlash : b.image;
        }
    }

    /**
     * Get's the image for a specific beat
     * 
     * @returns {string} base64 encoded image.
     * @param {number} beat - The beat (0-4).
	 * @access public
	 * @since 1.1.0
     */
    getBeatIcon(beat) {
        if (isNaN(beat) || beat < 0 || beat > 4) { beat = 0;}
        return this.beat[beat]
    }
}

exports = module.exports = instanceIcons;